const GIF = 'data:image/gif;base64,';

const outGIF = 'data:image/gif;base64,';

const test = require('tape'),
  base64Img = require('base64-img');

const ImageSequencer = require('../../../src/ImageSequencer');

target = 'test_outputs';

let sequencer = ImageSequencer({ui: false});
sequencer.loadImages(GIF);
sequencer.addSteps('brightness');

test('GIF input works correctly', t => {
  sequencer.run({mode: 'test'}, () => {
    let result = sequencer.steps[1].output.src;

    base64Img.imgSync(result, target, 'GIF-result');
    base64Img.imgSync(outGIF, target, 'GIF-benchmark');

    t.equal(result, outGIF);

    result = './test_outputs/GIF-result.gif';
    benchmark = './test_outputs/GIF-benchmark.gif';

    t.end();
  });
});